import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  Toolbar,
  Typography
  } from '@material-ui/core';
  import { withStyles } from '@material-ui/core/styles';

import ThreatMap from './ThreatMap';

const StyledLink = withStyles({
  root: {
    fontColor: "white"
  }
})(Link);

function App(){
  return(
    <BrowserRouter>
      <AppBar color="primary" position="sticky">
        <Toolbar>
          <StyledLink to="/">Demo App</StyledLink>
          </Toolbar>
      </AppBar>
      <div>
        <Button color="primary" component={Link} to="/network-threat-map">
          Network incidents near you
        </Button>
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
